import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import { Component } from 'react';
import Plan from './Plan';

class App  extends Component{
  render(){
    return(
      <div className="container-fluid my-5">
        <div className="row">
          <div className="col-sm-6 mx-auto shadow-lg p-3">
            <h1 className="text-center">Today's plan</h1>
              <div className="row">
                <div className="col-9">
                  <input type="text" className="form-control" placeholder="write plan here"/>
                </div>
                <div className="col-2">
                  <button className="btn btn-warning px-5 font-weight-bold">Add</button>
                </div>
                <div className="container-fluid"></div>
                <ul className="list-unstyled row m-5">
                  <Plan/>
                </ul>
              </div>
          </div>
        </div>
      </div>
    )
  }
}



export default App;
